   ┌-------┐ ┌-------┐ ┌-----┐ ┌-----┐         ┌-------┐
   |AVX DIV| |  Fast | | AGU | | AGU |         | BRANCH|
   └-------┘ |  LEA  | └-----┘ └-----┘         └-------┘
