   |AVX MUL| ┌-------┐┌-------┐                |  Fast |
   └-------┘ |AVX ADD||AVX FMA|                |  LEA  |
   ┌-------┐ └-------┘└-------┘                └-------┘
   |  AVX  |┌-------┐ ┌-------┐                ┌-------┐
   | Shift ||AVX FMA| |AVX MUL|                |  AVX  |
